- input: "TEXT\x1CC00432260\x1C.TEXT\x1C\x1CF3XA\x1CIn response to FEC letter dated
    12/20/10: Item 1: Due to a clerical error, we believed the a tv ad campaign opposing
    James Barnett in the KS-1 race was set to air on 7/21/10 with a 24 Hour Report
    due on 7/22/10.  On 7/22/10 we realized the ad had actually started to air on
    7/20/10, and immediately filed a 24 Hour Report showing all pertinent transactions
    related to this race. Items 2/3: The bundling data regarding the contributions
    in question was re-imported into the FECfile software to correctly match up all
    bundled contributions on Schedule A and B. On Schedule A, the aggreagate y-t-d
    totals refer to the donor's contributions to CFG PAC, not to any canidate or committee
    referenced in memo entries.  The FECfile software does not allow us to edit this
    field and all the data was imported in the format shown on the instructions for
    the FECfile software.\n"
